import React from 'react';

import useFetch from './hooks/useFetch';
import Albums from './components/Albums';

export default function App() {
  const { data, setData } = useFetch();
  return (
    <main>
      <input
        type='text'
        placeholder='Search'
        value={data.slug}
        onChange={(e) => setData({ ...data, slug: e.target.value })}
      />
    </main>
  );
}
